import React, { useState } from "react";
import { Box, FormControl, InputLabel, Input, FormHelperText, TextField, Container, CssBaseline, Button } from '@mui/material';
import { setIn } from "formik";

const ContactForm = () => {
    const [inputs, setInputs] = useState({
        name: "",
        email: "",
        password: ""
    });
    const handleChange = (e:any) => {
        setInputs((prevState) => ({ 
            ...prevState, 
            [e.target.name]: e.target.value 
        }))
    };
    const handleSubmit = (e: any) => {
        e.preventDefault();
        console.log(inputs);
    };
    return(
        <>
        <Container maxWidth="sm">
        <CssBaseline />  
        <Box
         display="flex"
         flexDirection={"column"}
         maxWidth={400}
         alignItems="center"
         justifyContent={"center"}
         margin="auto"
         marginTop={5}
         padding={3}
        borderRadius={5}
        boxShadow={"5px 5px 10px #000000"}
        >
        <h2>Contact</h2>
        <form onSubmit={handleSubmit}>
            <TextField
                name="name"
                value={inputs.name}
                onChange={handleChange}
                type={"text"}
                sx={{margin:3}}
                placeholder="Name"
                variant="outlined"
            /> 
            <TextField
                name="email"
                value={inputs.email}
                onChange={handleChange}
                type={"email"}
                sx={{margin:3}}
                placeholder="Email"
                variant="outlined"
            />  
            <TextField
                name="password"
                value={inputs.password}
                onChange={handleChange}
                type={"passward"}
                sx={{margin:3}}
                placeholder="Password"
                variant="outlined"
            /> 
            <TextField
                name="message"
                value={inputs.message}
                onChange={handleChange}
                label="Multiline"
                multiline
                rows={4}
                placeholder="Message"
            /> 
            <Button variant="contained" type="submit" sx={{margin:3}}>Submit</Button>
        </form>     
        </Box>
        </Container>
        </>
    );
}

export default ContactForm;
